import { Container, Row, Col } from "react-bootstrap";

function FilmDiv() {
  return (
    <div className="dataDiv">
      <row>
        <col>gradeavg</col>
        <col>TITLE</col>
        <col>year</col>
        <col>description</col>
      </row>
    </div>
  )
}


function Films() {
    return (
      <Container fluid>
        <h1>Films</h1>
        <FilmDiv/>
      </Container>
    )
  }


export default Films;
